import React from 'react';
import { withStyles } from "@material-ui/styles";

const styles = {
  titleWrapper:{
    padding:"0px 48px",
    background:"none"
  }
};

function ProjectTitle(props) {
  const { classes } = props;
  return (
    <div className={classes.titleWrapper}>
      <h1>Cash On Delivery</h1>
    </div>
  )
}

export default withStyles(styles)(ProjectTitle);
